-- ----------------------------
-- Table structure for sys_oa_bid
-- ----------------------------
DROP TABLE IF EXISTS `sys_oa_bid`;
CREATE TABLE `sys_oa_bid` (
  `bid_id` bigint NOT NULL COMMENT '文章id',
  `bid_title` varchar(64) DEFAULT '' COMMENT '投标项目名称',
  `bid_number` varchar(64) DEFAULT '' COMMENT '采购项目编号',
  `bid_type` char(1) DEFAULT '' COMMENT '采购方式(1公开招标 2竞争性谈判 3竞争性磋商)',
  `budget` varchar(126) DEFAULT NULL COMMENT '采购预算金额',
  `package_info` varchar(156) DEFAULT '' COMMENT '项目分包情况',
  `notice_time` varchar(255) DEFAULT NULL COMMENT '公告发布时间',
  `deadline` varchar(255) DEFAULT NULL COMMENT '获取文件期限(开始和结束时间)',
  `sign_type` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '' COMMENT '报名方式(1线上报名 0线下报名)',
  `pattern_file` varchar(255) DEFAULT '' COMMENT '获取招标文件方式',
  `expiration_time` varchar(255) DEFAULT NULL COMMENT '投标截止时间',
  `bid_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '' COMMENT '开标地点',
  `client_name` varchar(126) DEFAULT '' COMMENT '采购人联系人',
  `agency` varchar(126) DEFAULT '' COMMENT '采购代理机构',
  `document` varchar(255) DEFAULT NULL COMMENT '缴纳保证金情况',
  `document_info` json DEFAULT NULL COMMENT '保证金缴纳信息',
  `is_win` char(1) DEFAULT '0' COMMENT '是否中标:1中标,2未中标',
  `remark` text COMMENT '备注',
  `accessory` text COMMENT '附件',
  `create_by` varchar(32) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`bid_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='投标管理表';

