-- ----------------------------
-- Table structure for sys_oa_detail
-- ----------------------------
DROP TABLE IF EXISTS `sys_oa_detail`;
CREATE TABLE `sys_oa_detail` (
  `detail_id` bigint NOT NULL COMMENT 'ID',
  `finance_id` bigint NOT NULL COMMENT '进出账主表ID',
  `detail_title` varchar(64) DEFAULT '' COMMENT '名称',
  `price` decimal(24,2) DEFAULT NULL COMMENT '金额',
  `big_price` varchar(126) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '大写金额',
  `exit_type` char(1) DEFAULT NULL COMMENT '进出账类型(1入账,0出账)',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(32) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`detail_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='进出账明细表';

-- ----------------------------
-- Records of sys_oa_detail
