-- ----------------------------
-- Table structure for sys_oa_finance
-- ----------------------------
DROP TABLE IF EXISTS `sys_oa_finance`;
CREATE TABLE `sys_oa_finance` (
  `finance_id` bigint NOT NULL COMMENT 'ID',
  `project_id` bigint DEFAULT '0' COMMENT '项目ID',
  `finance_title` varchar(64) DEFAULT '' COMMENT '账务名称',
  `finance_parties` varchar(32) DEFAULT '' COMMENT '经手人/付款方',
  `pay_type` char(1) DEFAULT NULL COMMENT '支付类型(1对公转账，2现金支付)',
  `finance_type` char(1) DEFAULT NULL COMMENT '进出账类型(0支出，1入账)',
  `finance_time` datetime DEFAULT NULL COMMENT '交易时间',
  `accessory` text COMMENT '附件',
  `make_time` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '开票时间',
  `make_ratio` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '开票比例',
  `make_price` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '开票金额',
  `make_explain` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '开票情况说明',
  `remark` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '备注',
  `create_by` varchar(32) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`finance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='进出账主表';

