-- ----------------------------
-- Table structure for sys_oa_project
-- ----------------------------
DROP TABLE IF EXISTS `sys_oa_project`;
CREATE TABLE `sys_oa_project` (
  `project_id` bigint NOT NULL COMMENT 'ID',
  `project_name` varchar(126) DEFAULT '' COMMENT '项目名称',
  `project_num` varchar(64) DEFAULT '' COMMENT '项目编号',
  `project_type` char(1) DEFAULT NULL COMMENT '项目类型(1中标，2其他)',
  `address` varchar(126) DEFAULT '' COMMENT '项目地址',
  `funds` decimal(24,2) DEFAULT NULL COMMENT '项目总款',
  `functionary` varchar(32) DEFAULT '' COMMENT '项目负责人',
  `begin_time` datetime DEFAULT NULL COMMENT '开始日期',
  `finish_time` datetime DEFAULT NULL COMMENT '结束日期',
  `delivery` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '交货期',
  `guarantee` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '质保期',
  `introduction` varchar(256) DEFAULT '' COMMENT '项目介绍',
  `project_grade` char(1) DEFAULT '0' COMMENT '优先级（0一般 1中 2高）',
  `project_status` char(1) DEFAULT '0' COMMENT '状态（0进行中 1完结）',
  `contract_id` bigint DEFAULT NULL COMMENT '关联合同ID',
  `invoice_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '开票单位名称',
  `invoice_number` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '纳税人识别号',
  `invoice_address` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '开票地址电话',
  `invoice_bank` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '开户行及账号',
  `accessory` text COMMENT '附件',
  `bail` json DEFAULT NULL COMMENT '履约保证金',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(32) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`project_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='项目管理表';

