-- Records of sys_oa_project
-- ----------------------------
BEGIN;
INSERT INTO `sys_oa_project` (`project_id`, `project_name`, `project_num`, `project_type`, `address`, `funds`, `functionary`, `begin_time`, `finish_time`, `delivery`, `guarantee`, `introduction`, `project_grade`, `project_status`, `contract_id`, `invoice_name`, `invoice_number`, `invoice_address`, `invoice_bank`, `accessory`, `bail`, `remark`, `create_by`, `create_time`, `update_by`, `update_time`) VALUES (1795992349147906049, '项目名称之演示数据', '川（货物）2024-023', '1', '某市教育局', 126850.00, 'z', '2024-08-01 00:00:00', '2024-09-30 00:00:00', '合同签订后20 天交付', '自验收合格之日起 1 年', '', '2', '0', NULL, NULL, NULL, NULL, NULL, '1797443411818000386', '{\"money\": \"1842.50元\", \"ratio\": \"5%\", \"remark\": \"剩余合同总价款的5%\", \"theTime\": \"2024.8.21\", \"backTime\": \"2024.8.21\", \"backMoney\": \"1842.50元\"}', NULL, 'lmx', '2024-05-30 09:35:19', 'admin', '2024-07-07 17:47:06');
