-- ----------------------------
-- Table structure for sys_oa_task
-- ----------------------------
DROP TABLE IF EXISTS `sys_oa_task`;
CREATE TABLE `sys_oa_task` (
  `task_id` bigint NOT NULL COMMENT 'ID',
  `project_id` bigint DEFAULT NULL COMMENT '项目ID',
  `task_title` varchar(126) DEFAULT '' COMMENT '任务主题',
  `task_type` char(1) DEFAULT '0' COMMENT '工作类型(1接待，2沟通 3方案策划等)',
  `task_grade` char(1) DEFAULT '0' COMMENT '优先级（0一般 1中 2高）',
  `collaborator` varchar(64) DEFAULT '' COMMENT '协作人员',
  `begin_time` datetime DEFAULT NULL COMMENT '开始时间',
  `finish_time` datetime DEFAULT NULL COMMENT '结束时间',
  `content` text COMMENT '详细描述',
  `accessory` text COMMENT '附件',
  `remark` varchar(256) DEFAULT '' COMMENT '备注',
  `create_by` varchar(32) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='任务管理表';

